import React, { Component } from 'react'

//Class Component
export default class FirstComponent extends Component {
    render() {
      return (
        <div className="firstComponent">
           FirstComponent
        </div>
      );
    }
  }

//Class Component
export class SecondComponent extends Component {
    render() {
      return (
        <div className="secondComponent">
           Second Component
        </div>
      );
    }
  }
